import React, { useState } from "react";
import { packages } from "./packages";
import { PackCard } from "./PackCard";
import ".//dealer.styles.css";

export const Dealer = () => {
  const isDealer = useState(false);
  const password = useState("lswtdealer");

  const showPrice = (isTrue) => {
    if (isTrue) document.getElementById("dealer-ctn").style.display = "block";
    if (!isTrue) document.getElementById("dealer-ctn").style.display = "none";
  };

  return (
    <div id="dealer-ctn">
      <div className="dealer-login">
        <input placeholder="please enter password" type="text" name="" id="" />
        <button className="btn btn-submit">SUBMIT</button>
      </div>

      <div className="main-dealer-container">
        {packages.map((el) => (
          <PackCard opts={el} />
        ))}
      </div>
      <a className="book" href="/contact">
        <button className="btn btn-book">Book A Vehicle</button>
      </a>
    </div>
  );
};
